import React from "react";

const Nav = () => {
  return (
    <nav className="#4db6ac teal lighten-2">
      <ul class="row">
        <li class="col s12 m4 l4 center">Sass</li>
        <li class="col s12 m4 l4 center">Components</li>
        <li class="col s12 m4 l4 center">JavaScript</li>
      </ul>
    </nav>
  );
};

export default Nav;
